import React, { Component } from 'react';
import './App.css';
import ImovelMaps from './ImovelMaps';
import CSVReader from 'react-csv-reader'

class App extends Component {
  constructor() {
      super();
      this.imoveisLoaded = this.imoveisLoaded.bind(this);
      this.imoveisError = this.imoveisError.bind(this);
      this.state = {
          imoveis: null,
      }
  }

  imoveisError(error) {
      console.log(error);
  }

  imoveisLoaded(csvdata) {
      this.setState({
          imoveis: csvdata
      });
      console.log(this.state.imoveis.length);
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
            <h1>Mapa dos Imoveis</h1>
        </header>
        <div className="csv-reader">
          <CSVReader
            cssClass="csv-input"
            label="Selecione um arquivo no formato CSV"
            onFileLoaded={this.imoveisLoaded}
            onError={this.imoveisError}
            inputId="csvfile"
            inputStyle={{color: 'red'}}
          />
        </div>
        <div id="imoveis-map">
          <ImovelMaps imoveisData={this.state.imoveis}/>
        </div>
      </div>
    );
  }
}

export default App;
